    @RequestMapping(value = "/list", method = RequestMethod.GET)
    @ResponseBody
    public void queryJsfMethodInfo(HttpServletResponse response) throws Exception {
        List<InterfaceInfoDown> downList = new ArrayList<>();
        try {
            log.error("JsfTestController.queryJsfMethodInfo ");
            int pageSize = 40, startNo = 0, totalNo = 0;
            Boolean flag = true;
            QueryInterfaceRequest queryInterfaceRequest = JSFArgBuilder.buildQueryInterfaceRequest();
            queryInterfaceRequest.setPageSize(pageSize);
            queryInterfaceRequest.setInterfaceName("com");
            int count = 0;
            int endCount = 1000;
            int totalCount = 0;
            do {
                //最多循环1万次
                totalCount = totalCount + 1;
                if (totalCount > 10000) {
                    break;
                }
                queryInterfaceRequest.setOffset(startNo);
                try {
                    Result<List<InterfaceInfo>> interfaceListResult = interfaceService.searchInterface(queryInterfaceRequest);
                    totalNo = interfaceListResult.getTotal();
                    startNo = startNo + pageSize;
                    for (InterfaceInfo data : interfaceListResult.getData()) {
                        InterfaceInfoDown interfaceInfoDown = new InterfaceInfoDown();
                        BeanUtils.copyProperties(interfaceInfoDown, data);
                        //设置部门信息
                        buildSetDepartment(interfaceInfoDown);
                        //设置应用code
                        final String appCode = buildSetAppCode(data, interfaceInfoDown);
                        //设置调用方消费应用术
                        if(appList.contains(appCode)){
                            buildSetConsumerAppNo(data, interfaceInfoDown);
                        }

                        downList.add(interfaceInfoDown);
                    }
                    count = count + 1;
                } catch (Throwable e) {
                    log.error("JsfTestController.while in exception ", e);
                }
                if (flag) {
                    break;
                }
            } while (startNo < totalNo && count <= endCount);

        } catch (Throwable e) {
            log.error("JsfTestController.queryJsfMethodInfo exception ", e);
        }finally {
            DownloadUtils.download(response, InterfaceInfo.class, downList);
        }
    }

