    private String buildSetAppCode(InterfaceInfo data, InterfaceInfoDown interfaceInfoDown) {
        String jdosAppCode = "";
        try {
            if (interfaceInfoDown.getProviderLive() > 0) {
                jdosAppCode = providerServiceWrap.getProviderJdosAppCode(data.getInterfaceName());
                jdosAppCode = jdosAppCode.replace("jdos_", "");
                interfaceInfoDown.setJdosAppCode(jdosAppCode);
            }
        } catch (Exception e) {
            interfaceInfoDown.setErrorMsg("JsfTestController.buildSetAppCode" + e.getMessage());
            log.error("JsfTestController.buildSetAppCode exception ", e);
        }
        return jdosAppCode;
    }

    private void buildSetDepartment(InterfaceInfoDown interfaceInfoDown) {
        try {
            String[] split = interfaceInfoDown.getOwnerUser().split(",");
            if (split.length > 0) {
                UserVo userVo = userHelper.getUserBaseInfoByUserName(split[0]);
                if (Objects.nonNull(userVo)) {
                    interfaceInfoDown.setCjgDepartment(userVo.getOrganizationFullName());
                }
            }
        } catch (Exception e) {
            interfaceInfoDown.setErrorMsg("JsfTestController.CjgDepartment" + e.getMessage());
            log.error("JsfTestController.buildSetDepartment exception ", e);
        }
    }

    private void buildSetConsumerAppNo(InterfaceInfo data, InterfaceInfoDown interfaceInfoDown) {
        try {
            BaseRequest baseRequest = JSFArgBuilder.buildSetRequestInfo(new BaseRequest());
            baseRequest.setData(data.getInterfaceName());
            Result<List<AppDictVo>> appInfo = consumerService.getAppInfo(baseRequest);
            if (Objects.nonNull(appInfo) && CollectionUtils.isNotEmpty(appInfo.getData())) {
                String result = appInfo.getData().stream().map(appDicVo->{
                    return appDicVo.getAppName().replace("jdos_", "");})
                        .collect(Collectors.joining(","));
                interfaceInfoDown.setConsumerApCodes(result);
            }
        } catch (Exception e) {
            interfaceInfoDown.setErrorMsg("JsfTestController.ConsumerAppNo" + e.getMessage());
            log.error("JsfTestController.buildSetConsumerAppNo exception ", e);
        }
    }



