    @RequestMapping(value = "/exportXInterface", method = RequestMethod.GET)
    @ResponseBody
    public CommonResult<List<String>> exportXInterface()  {
        List<String> result = new ArrayList<>();
        List<SynJsfInfo> synJsfInfos = synJsfInfoService.queryList();
        log.info("JsfTestController.exportXInterface size"+synJsfInfos.size());
        final List<String> dataList = synJsfInfos.stream().map(SynJsfInfo::getInterfaceName).collect(Collectors.toList());
        String dataStr = obtainInterfaceList();
        String[] split = dataStr.split(",");
        for (String interfaceName : split) {
            if(!dataList.contains(interfaceName)){
                result.add(interfaceName);
            }
        }
        return CommonResult.buildSuccessResult(result);
    }


